migrant boy died at sea when an inflatable boat carrying 15 migrants and an operator smashed on rocks off the coast of the island of Chios, Greece. The boat engine exploded and all passengers jumped into the sea. The other 14 passengers and the 18-year-old operator made it safely to the beach, but the boy was unconscious when coast guard officers arrived and his death was confirmed in the hospital. Two other passengers were hospitalized, but their injuries were not life threatening.","At least nine people, including four children, died in the eastern Aegean Sea when a plastic boat carrying refugees overturned near the island of Kos, Greece. The Hellenic Coast Guard said it had rescued seven people and had located nine bodies, two of which were still trapped inside the overturned vessel. Crews were searching for between two and four more people listed as missing.  The dead were four children, four women and one man.","A boat en route to Greece capsized off the coast of Egypt, killing 8 and leaving only 5 survivors. Two of the bodies were identified as students from Daqahlia.","A man was found dead on the coast of Agathonisi, Greece.","","","A 4-year-old Iraqi girl drowned near Kos, Greece. Another child was reported missing.","","","11 bodies were recovered after a shipwreck off the coast of Samos, Greece. 6 of the dead were minors, including 4 infants. Of the dead, 5 were female. 15 survived the shipwreck.","","","","","Body of a male national from Iran found off the coast of Lesvos.","","","Three plastic boats carrying around 140 people capsized in the Aegean Sea due to bad weather and sea conditions after setting sail from Sivrice Bay, heading for Greeceâ€™s Lesbos Island. A passing dry cargo vessel noticed the migrants floating in the sea and brought around 130 aboard while also informing the Turkish Coast Guard. The Coast Guard rescued seven migrants with a helicopter, bringing them to Edremit State Hospital for treatment. Two children out of the seven migrants succumbed to their injuries in hospital, while officials found the bodies of a woman and a child at sea. ","The body of a 20-year-old woman was found on the shore of Lesvos.","A dead body of an infant was found off Agathonisi island, which has not been identified yet. All relevant investigations are being held by the police authorities in Samos.","After embarking from El Hoceima, in northern Morocco, a boat carrying migrants cracked and eventually lost its bottom. Relief Spanish Sea recovered the bodies of four men, and rescued 13 men and two women. Another 35 remain missing. The search for the missing has been suspended indefinitely.","A woman and two children died when a migrant boat sunk off the island of Rhodes, Greece. Four people are still missing, while six were saved.","A Turkish agency two others aremissing after two new accidents Friday involving boats en route to the Greek islands of Lesbos and Samos.","","","A fiber boat capsized off the coast of Kucukkuyu, Turkey. Coast guard rescued 19, but the bodies of four children, between the ages of one and four years, were found in the water.","A 7-year-old boy died off the coast of Lesvos, Greece. A 12-month-old girl who had been on the same boat was died the next day in a Greek hospital.","3 children drowned and another man was reported missing after a shipwreck near the coast of Samos, Greece. ","The Greek coastguard rescued 242 migrants when their wooden boat sank north of the island of Lesbos on Wednesday, but at least three drowned, including two small boys. Al Jazeera reports 38 missing.","A wooden boat carrying migrants took on water and sank in strong winds just before midnight. 19 people drowned and 138 were rescued, according the Merchant Marine Ministry.","A body in a state of advanced decomposition was found on the coast of the Greek island of Kalymnos.","The body of an infant was found on the coast of Agia Fotia in the island of Lesvos, Greece","A 5-year-old migrant girl died in a hospital on Samos, Greece after the boat she was travelling on landed on the island.","A ship carrying over 300 migrants capsized north of Lesvos, leading to 43 deaths. 19 of the dead were children, and one was an infant. In the following weeks, 13 bodies from the shipwreck washed up on the shores of Lesvos. Note that 10 bodies were recovered from the 5 - 8 November.","The Turkish Coast Guard reported one dead and one missing after rescuing 43 migrants off the coast of Cesme, Turkey.","Hellenic Coast Guard said the body of a man was found on the Greek island of Chios. Later reported he was 21-years-old and from Syria. ","","","A Guinean migrant drowned after high winds caused a boat carrying migrants to capsize. Ten others survived, according to Spanish police. ","The Red Crescent reported that the bodies of 43 suspected migrants washed up on beaches located east of Tripoli. A total of 29 bodies were recovered on Saturday on beaches surrounding the port of Zliten, while 14 others were found on Sunday on a beach close to the port of Khoms. Of those found, 20 were minors, including 1 infant. 17 were male and 6 were female."," Four people, a woman and three children, drowned and one child was missing after their rubber boat capsized off of Lesvos, the Greek coast guard said.","One child and one unidentified adult drowned after their boat capsized. Turkish Coast Guard rescued 11 survivors and reported one missing.","The bodies of six people, including a baby, have been washed ashore in Libya. The identities and nationalities of the bodies have not been confirmed.","Twelve people drowned and 25 were rescued by Turkish Coast Guard after a boat carrying migrants sank off the shores of Turkey. 11 are still missing.","The Spanish Guardia Civil found a body and rescued 10 people from an overturned boat near Ceuta, Spain. The 10 survivors reported another man missing in the waters of the Mediterranean.","4 Syrian migrants drowned and one was reported missing overboard. The Hellenic Coast Guard reports that twelve survivors were rescued.","","The bodies of 4 children (3 girls and a boy) were found, while 3 others (a woman, man and child) remain missing. The four children found are Iraqi, and those missing likely are as well. 13 people survived the shipwreck, which happened off the coast of Kalolymnos. ","23 were rescued (17 men, 3 women, 3 children) and another 13 died (2 men, 5 women, 6 children) when their wooden boat capsized. Two bodies were recovered on the 16 and 17 October 2015.","A collision between a wooden boat carrying Lebanese refugees and a Greek Coast Guard vessel occurred during a rescue mission. The bodies of four children, one of them a baby, were among those of seven dead migrants recovered. 31 survived the crash and 2 remain missing.","","","","A rubber boat carrying the Safwan family, from Lebanon, sank after it was punctured. Of the 12 family members in the boat, 5 woman and 4 men died or are missing, including 5 children and a pregnant woman. The 3 who survived were 2 men and a boy.","Eleven migrants from Syria and Northern Africa drowned when a boat bound for Europe capsized off the Egyptian port of Baltim. The coastguard took into custody 15 survivors identified as Syrians, Egyptian and people of other African nationalities after the sinking of the trawler Saturday night.","\"During a rescue operation which took place early in the morning, the Hellenic Coast Guard rescued 56 migrants from an ungovernable boat while an infant was detected unconscious. Some of those  who were on board were rescued from the sea while the infant had remained on the boat.","Two migrants died and 20 others were injured at the Spanish-Moroccan border, after a raft on which they were travelling was overturned by the Moroccan Royal Marines.","The bodies of a boy between ages 3 and 5 and a male infant were recovered by the Hellenic Coast Guard off the Greek island of Kos. ","85 bodies found washed ashore near Tripoli, 10 near Sabartha","\"A woman between 32 and 34 years of age, and a young boy drowned in a shipwreck near the coast of Lesvos, while 48-50 Afghan nationals were rescued and transferred at Lesvos Island. According to the testimonies of those who were rescued, no one is missing.","","","","","","","","Collision between Turkish trade ship and migrant dinghy. The Coast Guard Command's prompt response led to 8 migrants rescued, one remains heavily injured. Of the 13 deceased migrants found, including six children.    ","Body of 5 year old Syrian girl was found; a further 12 were drowned. Hellenic Coast Guard rescued 11, an additional 2 survivors swam on their own to shore. ","Preliminary reports indicate that the boat sank while trying to reach Greece.  Turkish coastal officials were eventually able to save 14 Syrians, including eight children.  The survivors were sent to the District Gendarme Command Center.","124 migrants were picked up by the Italian Navy and transferred to the MOAS-MSF vessel, the Phoenix. Among them, there was one deceased Nigerian woman of roughly 20 years of age. The rescued migrants were all from Sub-Saharan Africa, with the great majority coming from Nigeria. Survivors were disembarked in Lampedusa on 18 September, along with 131 others picked up earlier by the Phoenix.  ","At least 22 migrants trying to reach Greece by boat, including 11 women and four children, drowned today when their vessel sank off Turkey's southwest coast. 211 migrants were rescued by the Turkish Coast Guard. Nationalities of the migrants are not yet known.","A fishing boat spotted the shipwreck and began rescue efforts, soon joined by the Turkish Coast Guard. While 11 were rescued, the bodies of 2 Syrians were recovered. ","\"Death of a 2-month-old Syrian infant was announced today by the Hellenic Coast Guard. The child, his family and others were in a dinghy approaching the island of Agathosini. Due to the weather conditions, the boat crashed on the rocks of the island and overturned. The infant was taken to Samos island for medical attention, but was pronounced dead a few hours later from injuries sustained in the crash. Location approximate.","","","Estimate revised in October 2016","","","","","","","","","","","","","","","","","","","","","Incident reported to IOM staff by survivors. ","","","","","Deaths reported between 17 and 26 November 2014.","Deaths reported betweem 17 and 24 November 2014.","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","The Hellenic Coast Guard rescued 98 migrants from an incident off the coast of Farmakonisi Island, after the migrantsÂ´wooden boat capsized in high winds. 34 bodies were found in the rescue, including 3 infants, 5 girls and 6 boys. 10 adult women and 9 men also lost their lives. The age and gender of one of the dead has not yet been reported. Survivors report another 4 missing. The survivors and one of the deceased children was taken to Leros Island. The other bodies were taken to the island of Rhodes where there are autopsy facilities. A week later, the 99 survivors were transferred to Rhodes Island to assist in the identification of the corpses. ","25 Syrians and Iraqis were rescued by the Hellenic Coast Guard near Samos, while 4 children drowned. The children include three Iraqi siblings (ages 8,10 and 13; 2 boys and a girl), and a 10-year-old Syrian boy. Mechanical damage is thought to have caused the shipwreck. ","","\"IOM Rome reports up to 20 migrants missing and presumed drowned after rubber dinghy carrying between 120-130 overturned off coast of Libya on Sunday, 6 September. 107 have been rescued by 2 Italian Coast Guard vessels and brought to Lampedusa. 41 women from Nigeria on board. No women among the missing migrants. ","La Guardia Civil retrieved the body of a migrant who was clutching a tire in the waters of the Strait of Gibraltar and are looking for another who was in the same conditions, Maritime Rescue Service reported on Sunday.","About 40 people are missing in the Mediterranean after a dinghy carrying 130-140 migrants deflated, causing panic on board. Having sailed from Misrata, Libya, the dinghy began to deflate 6-7 hours after departure, and people fell into the water and drowned. 91 survivors have been rescued and one body recovered. ","","","","","","Killed during conflict between smugglers and Hellenic Coast Guard","Trampled by other migrants after they fainted from fumes","","6 found dead in two separate incidents.","Died in the First Reception Service","","People on board reportedly from Syria, Bangladesh and several sub-Saharan African countries","124 people were brought to Lampedusa, together with the corpses of 3 women, who died of asphyxiation. At least other 5 are reported missing","","IOM Greece is reporting the deaths of three Iraqi nationals, 30, 23, and 18-19 years of age. Two more 18-19 year old Iraqi nationals remain missing along with the smuggler, a Turkish national. Eight others, also Iraqi nationals, were rescued by the Hellenic Coast Guard. ","The man died following a shipwreck off the coast of Lesvos, Greece. The 19 survivors spent hours in the water before being rescued by the Hellenic Coast Guard.","","The incident occurred as a group of Syrians was travelling the short distance from the coast of Turkey to the Greek island of Kos. Two men and a child survived for hours by breathing air trapped underneath the overturned hull of the boat, before being rescued.  About 20 survivors were taken to the town of Turgutreis. It is not yet clear which boat they had been on, as other rescues also occurred on the same day. ","A boat of about 40 Palestinians departed from the Lebanese port of Tripoli and capsized after entering Turkish waters. At least 9 are believed to have died, including women and children. It is reported that the Palestinians were from the Yarmouk refugee camp in Damascus. ","The woman's body was found during a rescue operation in rough waters off the coast of Calabria; another 354 migrants were saved. The rescue operation was carried out by two Italian coast guard ships, a Croatian coast guard vessel deployed under the Triton mission and a merchant ship. Nationality has not been verified. The deceased woman is believed to be from Somalia.","","","","49 migrants were found dead on a ship carrying hundreds of people rescued by the Italian Navy vessel \"Cigala Fulgosi\" 21 miles off Libya's coast. The bodies of the 49 migrants were discovered by Italian navy officers in the hold of the ship, partially immersed in water and fuel. It is likely the migrants died of asphyxiation due to the fumes coming from the engine. According to early reports, the \"Cigala Fulgosi\" responded to a distress call and reached the 15-meter-long fishing trawler carrying the migrants, which left Zwara in the night between Friday and Saturday. By the end of operations 313 migrants were rescued, mainly from Morocco, Bangladesh, Pakistan, Sub-Sahara Africa and Syria. Nationalities of the deceased are still being verified. The bodies and survivors were transferred at high sea to the Norwegian vessel \"Siem Pilot\", which is patrolling the Mediterranean in the framework of the Triton operation.It is unclear if there are still migrants unaccounted for.","The number of missing is still undetermined, and will be updated as soon as more information becomes available. 25 bodies were recovered and survivorsÂ´ reports suggest between 200 and 250 may be missing, all presumed dead. ","","Man suffocated while being smuggled to Spain in a suitcase ","","","","","At least 100 bodies believed to be migrants were found around Tajoura, Libya. Reports confirm that women and children are among the dead, but the more specific information remains unreported as of November 2015.","Number on board boat estimated between 37 and 40","Bodies found on July 6th and 9th in state of decomposition. Date(s) on which deaths occurred is undetermined. ","","","","","","","","","","","e body of a 16-year-old Syrian boy smuggled from Turkey was found at the foot of a cliff on the Greek island of Kos. It was unclear for how long the boy had been dead.","The Turkish Coast Guard recovered 3 bodies and rescued 73 survivors after their boat capsized en route to Lesvos, Greece from Canakkale, Turkey.","","","A boat carrying around 35 people heading for the Greek island of Chios sank off the coast of Cesme, Izmir province. 3 bodies were found washed up on a Turkish beach, while the 2 survivors reported at least 30 missing. One of the survivors, Ali Alsaho, lost his wife and 7 children in the accident","","A boat capsized off the coast of Farmakonisi, Greece, killing 12 migrants, including 5 children. 8 more are still missing, while 26 were rescued.","","Six Afghan children drowned after an inflatable migrant boat capsized off the coast of Cesme, Izmir, Turkey en route to Chios, Greece. 8 other migrants were rescued by the Turkish Coast Guard.","Four Iraqi refugees drowned, while nine remain missing after their boat capsized near Farmakonisi, Greece. Turkish Coast Guard rescued two refugees from the water, while five others managed to swim back to the Turkish mainland.","A six-month-old migrant baby was found dead off the Aegean coast after a migrant boat bound for Farmakonisi capsized on Dec. 8 at around 10 p.m. The Turkish coast guard reportedly rescued 18 migrants, including six children, after that capsizing.","The body of a migrant was found washed up on the Greek island of Kos.","4 bodies were found off the coast of Farmakonisi, Greece. 2 were adult men, 1 was an adult woman, while 1 body was that of an infant.","A corpse of a man in advanced sepsis was found in Megisti island. No further information on his identity is available.","Two Iraqi children, aged six and two, were found dead off the Turkish resort town of Çeşme after trying to reach EU member Greece.  The bodies of the two children were found floating in the sea by local fishermen who then handed them over to the İzmir coastguard.  The children had been among 200 migrants trying to reach Greece by crossing the Aegean in the same journey. All others were rescued after their boat sank.","","A 10-year-old boy named Nergis died on Monday after one of three boats carrying refugees sank off Turkey's western Izmir coast, en route to Lesvos, Greece.   More than 100 Syrian and Afghan refugees in the three boats were rescued by the Turkish Coast Guard.","Turkish coast guards rescued 58 people of Iraqi, Syrian and Afghan nationality, including 22 children, after a 14-meter boat capsized.","","","","The Turkish Coast Guard rescued the other four migrants from the boat that departed from Bodrum’s Turgutreis neighborhood to reach the Greek island of Kos.","","","","","","","","","","The body of a woman in her 30s was discovered on the rocks . The 8 missing are presumed dead and are thought to likely be women who couldn't swim. Survivors were mainly women. Migrants traveled from Turkey to Greece and then to Italy. Smugglers escaped on a second boat after throwing the migrants into the water to make it to shore on their own (even if they did not have life jackets and could not swim. Women who protested were beaten.","","The Turkish Coast Guard found the bodies of a girl and two women near Ayvacik, Turkey, after a boat partially capsized. The Coast Guard rescued 13 people, but a search continued for two men and a boy.","Greek authorities say a baby has been found dead after a boat full of migrants reached the small eastern Aegean Sea island of Farmakonissi, while 63 people were picked up alive.","Three refugee children died after a dinghy capsized off the Greek island of Agathonisi near to Turkey's Didim coast. According to the Greek coast guard, 20 other people were rescued from the boat.","At least four people, including three children, drowned when a vessel carrying refugees sank off the Ahmetce area of Çanakkale's Ayvacık district as it tried to reach the Greek island of Lesvos. Rescue squads pulled the bodies of three children from the Aegean Sea and rescued two other people, while fishermen found one female refugee drowned in the sea and rescued six more. Another young refugee was rescued from the sea by coast guard teams after the survivors told Turkish officials at the hospital that they were in 13 in the vessel.","A survivor of a shipwreck swam until the shores of Samos island and informed the authorities that he was on a boat with 15 more migrants on board. The HCG began immediately with search operations at which 6 dead bodies were found. No evidence of shipwreck were found close to the dead bodies.","The HCG found one dead body in advanced sepsis at the shores of Samos island at Remataki area","","","The Turkish Coast Guard confirmed the death toll, which includes eleven children and one pregnant woman.  Some 21 people are said to have been rescued, so far.","","","","","","11 Syrian migrants, including children, have drowned off Turkey’s west coast after a fiber boat carrying at least 18 Syrian migrants capsized off the Aegean province of Aydın, Turkey.","","","A mass attempt to scale the border fence on the Spanish island of Ceuta and reach European shores has left at least two people dead and 12 others injured. 185 African migrants and refugees swam all the way from Morocco and made it across the border fence on Friday, and were being treated for injuries. The incident occurred around 4am local time near Benzu, in the north of Ceuta.","","","","","","The survivors are Syrians, Iraqis and Pakistanis","A five-year-old child and a woman died of hypothermia after two boats capsized. At least 46 people were rescued, while the number of missing remains unknown.","A body in a state of advanced sepsis was found on Fourni Island, Greece","Migrants arriving in Italy reported that smugglers had killed one passenger and thrown between 8 and 10 overboard while they were in the Channel of Sicily.","A boat which was carrying 49 migrants crashed into rocky area at the Farmakonisi islands, Greece. The HCG immediately launched  search and rescue operations at which they found 6 dead children and 2 women. 41 migrants were rescued.","An incident happened at Kalolymnos island. The HCG managed to rescue 26 migrants from a capsized boat, while 34 migrants were found dead during the rescue operations. Out of those there were 16 women, 7 women and 11 children. Despite the fact that the number of those missing is not known, there are estimations that 70-100 migrants were on board.","Unclear is this incident occurred on the 19th or 21st of January.","","","Body brought to Sicily along with about 700 migrants who were rescued.","Body in advanced decay.","","At least five migrants were found dead off Turkey’s western coast on Jan. 26 after their boat capsized as they were trying to reach the Greek coast.  Fishermen in the Didim district of Aydın province in Turkey’s Aegean region informed coast guards of the dead migrants upon noticing their bodies floating on the water. The Turkish Coast Guard removed the five bodies from the water and rescued one migrant, who was not reported to be in a life-threatening condition.  The rescued migrant said there were another 16 migrants on the boat.","Seven bodies have been recovered from a boat carrying migrants or refugees which sank off the northern coast of the island of Kos. The coast guard said one survivor managed to reach the shore and raise the alarm.","","","","","2 bodies of those initially reported missing were found on Samos on the 29th January. 1 man was found in Mourtia, and 1 boy in Agia Markella, Samos, Greece.","","Situation is still developing, numbers may change to reflect new information.","Nine migrants, including two children, died when their boat sank off Turkey’s Aegean coast, near the Seferihisar shore of İzmir province. Eleven migrants who were waiting on the shore said the fiber boat sank due to the
